Real xi (start =  uconv);
Real xd (start = 0);

cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Island_V/f_Control_Current_Limiter

equation
	udrop_max = i_max*sqrt(sqr(Rseries/100)+Sqr(Xseries/100));
	umax = u+udrop_max;
	umin = u-udrop_max;
end Island_V/f_Control_Current_Limiter;

function Sqr
	input Real x;
	output Real y;
algorithm
	y = x*x;
end Sqr;

model Island_V/f_Control_PID_controller

equation
	//Proportional part:
	yp = Kp*yin;
	//Derivative part:
	dxd = Selfix(Td>0,(yin-xd)/Td,0);
	der(xd) = dxd;
	yd  = dxd*Kd;
	//Integration part:
	freeze_xi = Flipflop(((pre(xi)>=y_max) and (yin*Ki>0)) or ((pre(xi)<=y_min) and (yin*Ki<0)), ((pre(xi)<y_max) or ((pre(xi)>=y_max) and (yin*Ki<0))) and ((pre(xi)>y_min) or ((pre(xi)<=y_min) and (yin*Ki>0))));
	der(xi) = Select(freeze_xi, 0.0, yin*Ki); // Freeze integrator if outside limits
	yi  = LimConst(xi,y_min,y_max);
	//Output
	yout = Lim(yp+yi+yd,max(y_min,y_min_dyn),min(y_max,y_max_dyn));

end Island_V/f_Control_PID_controller;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Flipflop
	input  Boolean boolset;
	input  Boolean boolreset;
	output Boolean state;
algorithm
	if (boolset = true) and (boolreset = false) then
		state := true;
	end if;
	if (boolset = false) and (boolreset = true) then
		state := false;
	end if;	
end Flipflop;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

function Lim
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end Lim;

