Real df (start = 0);
Integer mode_f_mapping_cmd (start =  Mode_f_Mapping);

cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Island_V/f_Control_Multiplier

equation
	yo = -yi;

end Island_V/f_Control_Multiplier;

model Island_V/f_Control_Oscillator

constant Real pi;

equation
	der(xphi_t) =  Selfix(BoolRMS(), 2*pi*(df+fn*(1.0-fref)), 2*pi*f);                   
	phi_t = mod(xphi_t+pi(),2*pi)-pi();        // phi_t = xphi_t, output range: [-pi,pi]
	phi   = mod((phi_t+phi0)+pi(),2*pi)-pi();  // phi = phi_t + phi0, output range: [-pi,pi]
	cosphi = cos(phi);
	sinphi = sin(phi);

end Island_V/f_Control_Oscillator;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function BoolRMS
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end BoolRMS;

