model Island_V/f_Control_Gradient_Limiter

equation
	yo = Selfix(gradlim_on, GradLim(Selfix(gradlim_on,yi,0),(dy_min/100),(dy_max/100)), yi);

end Island_V/f_Control_Gradient_Limiter;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
