function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

model Island_V/f_Control_Frequency_Limiter

equation
	freeze_df = Picdro(umin-u+0.5, 0.001, 0.001);
	yo = Select(freeze_df,pre(yo),GradLim(LimConst(Select(freeze_df,0.0,yi), dfmin, dfmax),-ROCOFmax,ROCOFmax));

end Island_V/f_Control_Frequency_Limiter;

function Picdro
	input Boolean boolexpr;
	input Real Tpick;
	input Real Tdrop;
	output Boolean varA;
algorithm
	if boolexpr = true then
		varA = delay(1,Tpick);
	else if boolexpr = false then
		varA = delay(0,Tdrop);
	else
		varA = pre(varA)
	end if;
end Picdro;

